import React from "react";
import { Form, FormGroup, Row, Col, Container } from 'reactstrap';
import { FormControl, InputLabel, Select, MenuItem, TableContainer } from "@material-ui/core";
import MenuSuperior from "../menuSuperior/MenuSuperior";

import { withStyles, makeStyles } from '@material-ui/core/styles';
import { Button } from "@material-ui/core";
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow, {rows} from '@material-ui/core/TableRow';

const StyledTableCell = withStyles((theme) => ({
    head: {
        backgroundColor: theme.palette.common.blue,
        color: theme.palette.common.white,
    },
    body: {
        fontSize: 14,
    },
}))(TableCell);

const StyledTableRow = withStyles((theme) => ({
    root: {
        '&:nth-of-type(odd)': {
            backgroundColor: theme.palette.action.hover,
        },
    },
}))(TableRow);

const checkpromo = (props) => {
    return (
        <div>
            <MenuSuperior />
            <Container>
                <Form >
                    <Col sm={4} md={4} xl={4} lg={4}>
                        <FormGroup>
                            <FormControl>
                                <InputLabel id="select-label">Buscar</InputLabel>
                                <Select //buscar cÃ³digo dos fornecedores
                                    labelId="select-label"
                                    id="select"
                                >
                                    <MenuItem selected disabled value="">Selecione OpÃ§Ã£o</MenuItem>
                                    <MenuItem value=""></MenuItem>
                                </Select>
                            </FormControl>
                        </FormGroup>
                        <Button style={{ background: "#007bff", color: "white", borderRadius: "0%" }}>Filtrar</Button>{' '}
                    </Col>
                </Form>
            </Container>
            <Container >
                <Row xl="8">
                    <Form>
                        <Row>
                            <Col sm="12" md={{ size: 6, offset: 3 }}>
                                <FormGroup>
                                    <FormControl>
                                        <InputLabel id="select-label">Tipos de Consulta</InputLabel>
                                        <Select
                                            labelId="select-label"
                                            id="select"
                                        >
                                            <MenuItem selected disabled value="">Selecione OpÃ§Ã£o</MenuItem>
                                            <MenuItem value=""></MenuItem>
                                        </Select>
                                    </FormControl>
                                </FormGroup>

                                <Table bordered>
                                    <TableHead>
                                        <TableRow >
                                            <StyledTableCell>Consultas</StyledTableCell>
                                            <StyledTableCell>consulta</StyledTableCell>
                                            <StyledTableCell>consulta</StyledTableCell>
                                            <StyledTableCell>consulta</StyledTableCell>
                                        </TableRow>
                                    </TableHead>
                                    <TableBody>
                                        {rows.map((row) => (
                                            <StyledTableRow key={row.name}>
                                                <StyledTableCell component="th" scope="row">
                                                    {row.name}
                                                </StyledTableCell>
                                                <StyledTableCell align="right">{row.calories}</StyledTableCell>
                                                <StyledTableCell align="right">{row.fat}</StyledTableCell>
                                                <StyledTableCell align="right">{row.carbs}</StyledTableCell>
                                                <StyledTableCell align="right">{row.protein}</StyledTableCell>
                                            </StyledTableRow>
                                        ))}
                                    </TableBody>
                                </Table>
                            </Col>
                        </Row>
                    </Form>
                </Row>
            </Container>
        </div>
    );
}
export default checkpromo;
